6. `myKernel << <gridSize, blockSize >> >(d_data, n)`: This line launches the kernel function `myKernel` with the specified block size and grid size. The kernel will be executed on the GPU in parallel, with each block processing a portion of the array.
7. `cudaMemcpy()`: This function is used to copy the result of the kernel function back to host memory. In this program, we copy the device array `d_data` back to the host array `h_data`.
